import React, { useState } from "react";

function Brockerage() {
  const [activeTab, setActiveTab] = useState("equity");

  const renderTable = () => {
    switch (activeTab) {
      case "equity":
        return (
          <table className="table table-bordered mt-4">
            <thead className="table-light">
              <tr>
                <th>Category</th>
                <th>Details</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>Brokerage</td>
                <td>₹0 for delivery, ₹20 for intraday</td>
              </tr>
              <tr>
                <td>STT/CTT</td>
                <td>0.1% on buy & sell side</td>
              </tr>
              <tr>
                <td>Transaction Charges</td>
                <td>NSE: 0.00275%, BSE: 0.00375%</td>
              </tr>
            </tbody>
          </table>
        );

      case "currency":
        return (
          <table className="table table-bordered mt-4">
            <thead className="table-light">
              <tr>
                <th>Category</th>
                <th>Details</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>Brokerage</td>
                <td>0.03% or ₹20/executed order (whichever is lower)</td>
              </tr>
              <tr>
                <td>STT/CTT</td>
                <td>No STT for currency</td>
              </tr>
              <tr>
                <td>Transaction Charges</td>
                <td>NSE: 0.00035%, BSE: 0.00055%</td>
              </tr>
            </tbody>
          </table>
        );

      case "commodity":
        return (
          <table className="table table-bordered mt-4">
            <thead className="table-light">
              <tr>
                <th>Category</th>
                <th>Details</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>Brokerage</td>
                <td>0.03% or ₹20/executed order (whichever is lower)</td>
              </tr>
              <tr>
                <td>STT/CTT</td>
                <td>0.01% on sell side (non-agri)</td>
              </tr>
              <tr>
                <td>Transaction Charges</td>
                <td>MCX: 0.0027%, NSE: 0.001%</td>
              </tr>
            </tbody>
          </table>
        );

      default:
        return null;
    }
  };

  return (
    <div className="container mt-5">
      {/* Tabs */}
      <div className="btn-group d-flex justify-content-center">
        <button
          className={`btn ${
            activeTab === "equity" ? "btn-primary" : "btn-outline-primary"
          }`}
          onClick={() => setActiveTab("equity")}
        >
          Equity
        </button>
        <button
          className={`btn ${
            activeTab === "currency" ? "btn-primary" : "btn-outline-primary"
          }`}
          onClick={() => setActiveTab("currency")}
        >
          Currency
        </button>
        <button
          className={`btn ${
            activeTab === "commodity" ? "btn-primary" : "btn-outline-primary"
          }`}
          onClick={() => setActiveTab("commodity")}
        >
          Commodity
        </button>
      </div>

      {/* Render selected table */}
      {renderTable()}
    </div>
  );
}

export default Brockerage;
